INSERT INTO `cauhois` (`idcauhoi`, `linhvuc`, `trangthai`, `cauhoi`, `dapan1`, `dapan2`, `dapan3`, `dapan4`, `dapandung`, `created_at`, `updated_at`) VALUES
(1, 1, 1, 'Các hoạt động đầu tư xây dựng chịu sự điều chỉnh của pháp luật nào dưới đây?', 'Pháp luật về xây dựng', 'Pháp luật về xây dựng và pháp luật về đầu tư công', 'Pháp luật về xây dựng và pháp luật về đấu thầu', 'Pháp luật về xây dựng và pháp luật khác có liên quan', 4, '2021-04-06 06:03:45', '2021-04-19 03:19:46'),
(2, 1, 1, 'Theo quy định của pháp luật về xây dựng, hoạt động xây dựng gồm các công việc nào dưới đây?', 'Lập quy hoạch xây dựng, lập dự án đầu tư xây dựng công trình, khảo sát xây dựng', 'Thiết kế xây dựng, thi công xây dựng, giám sát xây dựng, quản lý dự án, lựa chọn nhà thầu, nghiệm thu, bàn giao đưa công trình vào khai thác sử dụng', 'Bảo hành, bảo trì công trình xây dựng và hoạt động khác có liên quan đến xây dựng công trình', 'Các công việc nêu tại điểm a, b và c', 4, '2021-04-06 06:04:10', '2021-04-16 00:18:42'),
(3, 1, 1, 'Dự án đầu tư xây dựng sử dụng vốn ODA thì thực hiện theo quy định nào?', 'Theo quy định của Hiệp định vay vốn mà Việt Nam ký kết với tổ chức cho vay', 'Theo pháp luật về xây dựng', 'Theo quy định của Hiệp định vay vốn mà Việt Nam ký kết với tổ chức cho vay, các quy định của pháp luật về xây dựng và pháp luật khác liên quan', 'Theo quy định của Hiệp định vay vốn mà Việt Nam ký kết với tổ chức cho vay và các quy định của pháp luật về xây dựng', 3, '2021-04-06 06:04:32', '2021-04-16 00:18:43'),
(4, 1, 1, 'Việc áp dụng tiêu chuẩn, quy chuẩn kỹ thuật trong hoạt động đầu tư xây dựng phải tuân thủ theo những nguyên tắc nào?', 'Tuân thủ Quy chuẩn kỹ thuật quốc gia', 'Tiêu chuẩn được viện dẫn trong quy chuẩn kỹ thuật hoặc văn bản quy phạm pháp luật khác có liên quan', 'Tiêu chuẩn được áp dụng trong hoạt động đầu tư xây dựng theo nguyên tắc tự nguyện', 'Tất cả các quy định tại a, b và c', 4, '2021-04-06 06:04:49', '2021-04-16 00:18:45'),
(5, 1, 1, 'Việc giám sát đánh giá đầu tư đối với các dự án đầu tư xây dựng sử dụng vốn nhà nước căn cứ vào các quy định nào?', 'Pháp luật về xây dựng', 'Pháp luật về đầu tư công', 'Pháp luật về đầu tư công và pháp luật về xây dựng', 'Pháp luật về đầu tư công, pháp luật về xây dựng và pháp luật khác có liên quan', 4, '2021-04-06 06:05:08', '2021-04-16 00:18:46'),
(6, 1, 1, 'Những chủ thể nào bắt buộc phải mua bảo hiểm công trình trong thời gian thi công xây dựng đối với công trình có ảnh hưởng đến an toàn cộng đồng, môi trường, công trình có yêu cầu kỹ thuật đặc thù, điều kiện thi công xây dựng phức tạp?', 'Chủ đầu tư xây dựng công trình', 'Nhà thầu thi công xây dựng công trình', 'Nhà thầu tư vấn thiết kế xây dựng công trình', 'Cả 3 chủ thể nêu tại a, b và c', 1, '2021-04-06 06:05:28', '2021-04-16 02:35:27'),
(7, 1, 1, 'Những chủ thể nào bắt buộc phải mua bảo hiểm trách nhiệm nghề nghiệp trong hoạt động đầu tư xây dựng?', 'Nhà thầu khảo sát xây dựng', 'Nhà thầu tư vấn thiết kế xây dựng công trình', 'Nhà thầu khảo sát xây dựng và Nhà thầu tư vấn thiết kế xây dựng công trình', 'Chủ đầu tư xây dựng công trình và Nhà thầu khảo sát xây dựng', 3, '2021-04-06 06:05:49', '2021-04-16 00:18:48'),
(8, 1, 1, 'Dự án đầu tư xây dựng được phân thành loại và nhóm A, B, C đối với các nguồn vốn nào?', 'Nguồn vốn ngân sách nhà nước', 'Nguồn vốn nhà nước ngoài ngân sách', 'Nguồn vốn khác không phải nguồn vốn nêu tại điểm a và b', 'Tất cả các nguồn vốn nêu tại điểm a, b và c', 4, '2021-04-06 06:06:28', '2021-04-16 00:18:49'),
(9, 1, 1, 'Theo quy định của pháp luật hiện hành về xây dựng, vốn nhà nước ngoài ngân sách bao gồm?', 'Vốn ODA, vốn vay ưu đãi của Nhà nước, vốn do Nhà nước bảo lãnh vay', 'Vốn phát triển của doanh nghiệp nhà nước, vốn góp tiền sử dụng đất của Doanh nghiệp nhà nước', 'Các dự án PPP', 'Các trường hợp trên', 4, '2021-04-06 06:06:45', '2021-04-16 02:15:22'),
(10, 1, 1, 'Theo quy định của pháp luật về xây dựng, những công tác gì được liệt kê dưới đây thuộc giai đoạn chuẩn bị đầu tư xây dựng ?', 'Xin chủ trương đầu tư xây dựng', 'Lập, thẩm định, phê duyệt Báo cáo nghiên cứu khả thi đầu tư xây dựng', 'Xin phép xây dựng', 'Bao gồm công tác a và b', 4, '2021-04-06 06:07:02', '2021-04-16 00:18:51'),
(11, 1, 1, 'Theo quy định của pháp luật về xây dựng, công tác nào sau đây ở giai đoạn thực hiện đầu tư xây dựng?', 'Tổ chức lựa chọn nhà thầu, tổng thầu xây dựng để thực hiện các bước thiết kế bản vẽ thi công, thi công xây dựng công trình', 'Thiết kế bản vẽ thi công và dự toán xây dựng', 'Lựa chọn nhà thầu giám sát thi công xây dựng', 'Tất cả các công tác trên', 4, '2021-04-06 06:07:21', '2021-04-16 00:18:52'),
(12, 1, 1, 'Theo quy định của pháp luật về xây dựng, công trình xây dựng được phân cấp trên cơ sở các căn cứ nào?', 'Quy mô, tầm quan trọng áp dụng cho từng loại công trình', 'Thời hạn sử dụng, vật liệu', 'Yêu cầu kỹ thuật xây dựng công trình', 'Tất cả các căn cứ trên', 4, '2021-04-06 06:07:38', '2021-04-16 00:18:53'),
(13, 1, 1, 'Việc phân loại công trình xây dựng theo quy định của pháp luật về xây dựng trên cơ sở tiêu chí nào?', 'Theo công năng sử dụng', 'Theo kiến trúc công trình', 'Do người quyết định đầu tư quy định', 'Do chủ đầu tư quy định', 1, '2021-04-06 06:07:53', '2021-04-16 00:18:54'),
(14, 1, 1, 'Những dự án đầu tư xây dựng nhóm nào có thể được phân chia thành các dự án thành phần hoặc phân kỳ đầu tư để quản lý thực hiện như một dự án độc lập?', 'Dự án quan trọng quốc gia, dự án nhóm A', 'Dự án chỉ yêu cầu lập Báo cáo kinh tế kỹ thuật', 'Dự án nhóm B, C', 'Cả 3 phương án a, b và c', 1, '2021-04-06 06:08:11', '2021-04-16 00:18:55'),
(15, 1, 1, 'Dự án đầu tư xây dựng phải đáp ứng các yêu cầu nào dưới đây?', 'Phù hợp với quy hoạch', 'Có phương án công nghệ và phương án thiết kế xây dựng phù hợp', 'Bảo đảm chất lượng, an toàn trong xây dựng và bảo vệ môi trường', 'Cả 3 phương án trên', 4, '2021-04-06 06:08:26', '2021-04-16 00:18:56'),
(16, 1, 1, 'Các dự án đầu tư xây dựng có quy mô nhóm nào yêu cầu phải lập Báo cáo nghiên cứu tiền khả thi để trình cấp có thẩm quyền cho phép đầu tư hoặc chấp thuận chủ trương đầu tư?', 'Dự án quan trọng quốc gia', 'Dự án nhóm A', 'Dự án quan trọng quốc gia và dự án nhóm A', 'Dự án quan trọng quốc gia, dự án nhóm A, nhóm B và nhóm C', 3, '2021-04-06 06:08:44', '2021-04-16 00:18:57'),
(17, 1, 1, 'Dự án đầu tư xây dựng có tổng mức đầu tư bao nhiêu (Trừ công trình xây dựng sử dụng cho mục đích tôn giáo) thì Chủ đầu tư phải lập Báo cáo nghiên cứu khả thi đầu tư xây dựng?', 'Từ 45 tỷ đồng trở lên', 'Từ 15 tỷ đồng trở lên', 'Từ 7 tỷ đồng trở lên', 'Từ 80 tỷ trở lên', 2, '2021-04-06 06:09:02', '2021-04-16 00:18:58'),
(18, 1, 1, 'Khi thẩm định dự án đầu tư xây dựng sử dụng vốn nhà nước ngoài ngân sách, cơ quan chuyên môn về xây dựng phải thẩm định những nội dung nào dưới đây?', 'Nội dung khác của báo cáo nghiên cứu khả thi đầu tư xây dựng', 'Thiết kế cơ sở phần xây dựng của báo cáo nghiên cứu khả thi đầu tư xây dựng', 'Thiết kế công nghệ của báo cáo nghiên cứu khả thi đầu tư xây dựng', 'Tất cả các nội dung tại a, b và c', 2, '2021-04-06 06:09:21', '2021-04-16 00:18:59'),
(19, 1, 1, 'Cơ quan nào chủ trì tổ chức thẩm định dự án đầu tư xây dựng (không thuộc diện dự án quan trọng quốc gia) sử dụng vốn ngân sách nhà nước?', 'Cơ quan chuyên môn về xây dựng theo phân cấp', 'Cơ quan chuyên môn trực thuộc người quyết định đầu tư', 'Cả phương án a và b', 'Chủ đầu tư xây dựng công trình', 1, '2021-04-06 06:09:42', '2021-04-16 00:19:00'),
(20, 1, 1, 'Đối với dự án sử dụng vốn nhà nước ngoài ngân sách thì cơ quan nào chủ trì thẩm định thiết kế công nghệ và các nội dung khác của Báo cáo nghiên cứu khả thi đầu tư xây dựng?', 'Sở Xây dựng', 'Cơ quan chuyên môn trực thuộc người quyết định đầu tư', 'Chủ đầu tư xây dựng', 'Văn phòng UBND tỉnh', 2, '2021-04-06 06:09:58', '2021-04-16 00:19:01'),
(21, 1, 1, 'Dự án đầu tư xây dựng nào dưới đây không bắt buộc phải lập báo cáo nghiên cứu khả thi mà chỉ cần lập Báo cáo kinh tế - kỹ thuật?', 'Dự án đầu tư xây dựng công trình tôn giáo và nhà ở riêng lẻ của hộ gia đình', 'Dự án đầu tư xây dựng công trình tôn giáo và dự án đầu tư xây dựng có tổng mức đầu tư dưới 15 tỷ đồng (không tính tiền sử dụng đất)', 'Cả trường hợp a và b', 'Các trường hợp a, b và c đều không đúng', 2, '2021-04-06 06:10:20', '2021-04-16 00:19:02'),
(22, 1, 1, 'Đối với dự án đầu tư xây dựng không sử dụng vốn nhà nước thì cơ quan chuyên môn về xây dựng thuộc các Bộ quản lý công trình xây dựng chuyên ngành thẩm định những nội dung nào của dự án?', 'Tất cả các nội dung của dự án', 'Thiết kế cơ sở của dự án đối với công trình cấp 1, cấp đặc biệt', 'Thiết kế cơ sở của dự án quan trọng quốc gia và dự án nhóm A', 'Thiết kế cơ sở và thiết kế công nghệ của dự án', 2, '2021-04-06 06:10:36', '2021-04-16 00:19:03'),
(23, 1, 1, 'Khi thẩm định thiết kế cơ sở của dự án đầu tư xây dựng yêu cầu phải xem xét đánh giá những nội dung gì?', 'Sự phù hợp của thiết kế với quy hoạch chi tiết xây dựng', 'Sự phù hợp của các giải pháp thiết kế về bảo đảm an toàn xây dựng, môi trường, phòng chống cháy nổ', 'Bao gồm cả a và b', 'Bao gồm cả a, b và đánh giá đảm bảo tính khả thi của dự án', 3, '2021-04-06 06:10:52', '2021-04-06 06:10:52'),
(24, 1, 1, 'Trong các nội dung thẩm định dự án không bao gồm nội dung nào dưới đây?', 'Xem xét các yếu tố bảo đảm tính hiệu quả và tính khả thi của dự án', 'Xem xét việc xác định tổng mức đầu tư của dự án', 'Xem xét việc xác định dự toán các công trình của dự án', 'Xem xét sự hợp lý của thiết kế cơ sở', 3, '2021-04-06 06:11:08', '2021-04-06 06:11:08'),
(25, 1, 1, 'Hợp đồng trong hoạt động xây dựng theo hình thức giá có những loại nào?', 'Hình thức trọn gói, hình thức theo thời gian', 'Hình thức điều chỉnh giá, Hình thức theo đơn giá cố định', 'Bao gồm các hình thức nêu tại a và b', 'Không có hình thức nào nêu tại a và b', 3, '2021-04-06 06:11:26', '2021-04-06 06:11:26'),
(26, 1, 1, 'Chức năng, nhiệm vụ của Ban QLDA chuyên ngành, ban QLDA khu vực do ai quy định?', 'Người có thẩm quyền quyết định đầu tư', 'Người có thẩm quyền quyết định thành lập Ban QLDA chuyên ngành, ban QLDA khu vực', 'Cơ quan chuyên môn về xây dựng', 'Chủ đầu tư', 2, '2021-04-06 06:11:41', '2021-04-06 06:11:41'),
