(34, 1, 1, 'Theo quy định của pháp luật về xây dựng, đối với các gói thầu sử dụng vốn nhà nước thì hiệu lực của hợp đồng xây dựng được tính từ thời điểm nào?', 'Từ ngày ký kết hợp đồng', 'Từ ngày bên giao thầu nhận được bảo đảm thực hiện hợp đồng của bên nhận thầu', 'Từ ngày do bên giao thầu và bên nhận thầu thỏa thuận trong hợp đồng', 'Bao gồm cả a, b và c', 3, '2021-04-06 06:13:53', '2021-04-06 06:14:13'),
