(89, 1, 1, 'Tổ chức hoạt động xây dựng mới được thành lập có những cá nhân có chứng chỉ hành nghề hạng 1 phù hợp với lĩnh vực mà tổ chức đề nghị cấp chứng chỉ năng lực hoạt động xây dựng, nhưng chưa ký hợp đồng để thực hiện bất kể công việc gì trong hoạt động đầu tư xây dựng thì có được cấp chứng chỉ năng lực hoạt động xây dựng hạng 1 không?', 'Có', 'Không', 'Có, nhưng chỉ được xem cấp chứng chỉ hành năng lực cho lĩnh vực định giá xây dựng', 'Có, nhưng chỉ được xem cấp chứng chỉ hành năng lực cho các lĩnh vực giám sát thi công xây dựng, kiểm định xây dựng', 2, '2021-04-06 06:29:38', '2021-04-06 06:29:38'),
