(91, 1, 1, 'Những người nào sau đây tham gia và ký biên bản nghiệm thu công việc xây dựng', 'Người giám sát thi công xây dựng công trình và người phụ trách kỹ thuật thi công trực tiếp của nhà thầu thi công xây dựng công trình', 'Người của Chủ đầu tư/Ban quản lý dự án, người giám sát thi công xây dựng công trình và người phụ trách kỹ thuật thi công trực tiếp của nhà thầu thi công xây dựng công trình', 'Người của Chủ đầu tư/Ban quản lý dự án và người phụ trách kỹ thuật thi công trực tiếp của nhà thầu thi công xây dựng công trình', 'Cả ba đáp án trên', 1, '2021-04-06 06:30:18', '2021-04-06 06:30:18'),
