(93, 1, 1, 'Thời hạn bảo trì công trình được tính như thế nào?', 'Sau khi kết thúc thời hạn bảo hành cho đến khi hết niên hạn sử dụng công trình', 'Từ ngày nghiệm thu đưa công trình xây dựng vào sử dụng cho đến khi hết niên hạn sử dụng công trình', 'Từ ngày chủ đầu tư bàn giao công trình cho chủ sở hữu hoặc người quản lý sử dụng công trình', 'Từ ngày có văn bản chấp thuận kết quả nghiệm thu của chủ đầu tư', 2, '2021-04-06 06:31:15', '2021-04-06 06:31:15'),
(94, 1, 1, 'Dự án nào sau đây yêu cầu phải lập Báo cáo nghiên cứu tiền khả thi đầu tư xây dựng ?', 'Dự án quan trọng quốc gia', 'Dự án quan trọng quốc gia, dự án nhóm A và nhóm B', 'Dự án quan trọng quốc gia và dự án nhóm A', 'Cả ba đáp án trên', 3, '2021-04-06 06:31:30', '2021-04-06 06:31:30'),
