(96, 1, 1, 'Quy định áp dụng Tiêu chuẩn kỹ thuật trong hoạt động đầu tư xây dựng như thế nào?', 'Bắt buộc đối với các tiêu chuẩn được viện dẫn trong quy chuẩn kỹ thuật hoặc văn bản quy phạm pháp luật khác có liên quan', 'Khuyến khích áp dụng', 'Theo nguyên tắc tự nguyện', 'Đáp án a và c', 4, '2021-04-06 06:32:09', '2021-04-06 06:32:09'),
(97, 1, 1, 'Những loại tiêu chuẩn nào sau đây bắt buộc áp dụng?', 'TCVN', 'Tiêu chuẩn nước ngoài', 'Các tiêu chuẩn nằm trong danh mục tiêu chuẩn đã được người quyết định đầu tư phê duyệt', 'Danh mục tiêu chuẩn do tư vấn thiết kế đệ trình', 3, '2021-04-06 06:32:26', '2021-04-06 06:32:26'),
