(101, 1, 1, 'Bắt buộc thực hiện lập chỉ dẫn kỹ thuật riêng đối với công trình nào sau đây?', 'Công trình ảnh hưởng đến an toàn cộng đồng', 'Toàn bộ các cấp', 'Cấp đặc biệt, cấp I và cấp II', 'Công trình quan trọng quốc gia', 3, '2021-04-06 06:33:57', '2021-04-08 06:53:57'),
(102, 1, 1, 'Đối với công trình xây dựng sử dụng vốn ngân sách nhà nước ai là người phê duyệt thiết kế kỹ thuật, dự toán xây dựng trường hợp thiết kế ba bước?', 'Người quyết định đầu tư', 'Chủ đầu tư', 'Giám đốc Ban quản lý dự án', 'Không phải các đáp án trên', 2, '2021-04-06 06:34:14', '2021-04-23 20:20:16'),
(103, 1, 1, 'Đối với công trình xây dựng sử dụng vốn ngân sách nhà nước ai là người phê duyệt thiết kế bản vẽ thi công trong trường hợp thiết kế ba bước?', 'Chủ đầu tư', 'Người quyết định đầu tư', 'Tư vấn thiết kế', 'Tư vấn giám sát', 1, '2021-04-06 06:34:27', '2021-04-06 06:34:27'),
(104, 1, 1, 'Cơ quan chuyên môn về xây dựng theo phân cấp yêu cầu chủ đầu tư lựa chọn tổ chức tư vấn thực hiện thẩm tra dự toán xây dựng công trình làm cơ sở cho việc thẩm định trước khi trình cấp có thẩm quyền phê duyệt đối với công trình dự án nhóm nào ?', 'Các công trình thuộc dự án quan trọng quốc gia, dự án nhóm A', 'Các công trình thuộc dự án quan trọng quốc gia, dự án nhóm A, B, C', 'Các công trình thuộc dự án quan trọng quốc gia, dự án nhóm A, B và C có kỹ thuật phức tạp hoặc áp dụng công nghệ cao', 'Các công trình có ảnh hưởng đến an toàn cộng đồng', 3, '2021-04-06 06:34:49', '2021-04-06 06:34:49'),
