(106, 1, 1, 'Nhà thầu thi công phải trình chủ đầu tư chấp thuận những tài liệu nào sau đây?', 'Kế hoạch tổ chức thí nghiệm và kiểm định chất lượng, quan trắc, đo đạc các thông số kỹ thuật của công trình theo yêu cầu thiết kế và chỉ dẫn kỹ thuật', 'Biện pháp kiểm tra, kiểm soát chất lượng vật liệu, sản phẩm, cấu kiện, thiết bị được sử dụng cho công trình; thiết kế biện pháp thi công, trong đó quy định cụ thể các biện pháp, bảo đảm an toàn cho người, máy, thiết bị và công trình', 'Kế hoạch kiểm tra, nghiệm thu công việc xây dựng, nghiệm thu giai đoạn thi công xây dựng hoặc bộ phận (hạng mục) công trình xây dựng, nghiệm thu hoàn thành hạng mục công trình, công trình xây dựng', 'Toàn bộ các tài liệu nêu trên', 4, '2021-04-06 06:35:31', '2021-04-06 06:35:31'),
(107, 1, 1, 'Việc giám sát thi công xây dựng công trình phải đảm bảo các yêu cầu sau ?', 'Thực hiện trong suốt quá trình thi công từ khi khởi công xây dựng, trong thời gian thực hiện cho đến khi hoàn thành và nghiệm thu công việc, công trình xây dựng', 'Giám sát thi công công trình đúng với thiết kế xây dựng được phê duyệt, tiêu chuẩn áp dụng, quy chuẩn kỹ thuật, quy định về quản lý, sử dụng vật liệu xây dựng, chỉ dẫn kỹ thuật và hợp đồng xây dựng', 'Trung thực khách quan, không vụ lợi', 'Tất cả các yêu cầu trên', 4, '2021-04-06 06:35:55', '2021-04-06 06:35:55'),
(108, 1, 1, 'Nhà thầu giám sát thi công xây dựng có trách nhiệm gì sau đây?', 'Thực hiện giám sát theo đúng hợp đồng', 'Từ chối nghiệm thu khi công trình không đạt yêu cầu về chất lượng', 'Giám sát việc thực hiện các quy định về an toàn, bảo vệ môi trường', 'Tất cả các điều trên', 4, '2021-04-06 06:36:12', '2021-04-06 06:36:12'),
(109, 1, 1, 'Tổ chức giám sát thi công xây dựng phải độc lập với các nhà thầu thi công xây dựng công trình trong các trường hợp nào sau đây ?', 'Các công trình đầu tư bằng nguồn vốn ngân sách nhà nước và nguồn vốn nhà nước ngoài ngân sách', 'Các công trình đầu tư bằng nguồn vốn khác', 'Các công trình áp dụng đầu tư theo hình thức đồi tác công tư', 'Tất cả các trường hợp trên', 1, '2021-04-06 06:36:26', '2021-04-06 06:36:26'),
(110, 1, 1, 'Bản vẽ hoàn công là bản vẽ nào sau đây?', 'Là bản vẽ công trình xây dựng hoàn thành, trong đó thể hiện vị trí, kích thước, vật liệu và thiết bị được sử dụng thực tế', 'Là bản vẽ của thiết kế kỹ thuật', 'Là bản vẽ của thiết kế bản vẽ thi công', 'Tất cả các đáp án trên', 1, '2021-04-06 06:36:40', '2021-04-06 06:36:40'),
