(115, 2, 1, 'Trong tiêu chuẩn thiết kế đường quy định cao độ thiết kế nền đường. Quy định nào trong 4 trường hợp sau đây là đúng và đủ?', 'Cao độ thiết kế của nền đường là cao độ ở tim đường', 'Cao độ thiết kế của nền đường là cao độ ở tim đường. Khi có hai nền đường độc lập sẽ có hai cao độ thiết kế trên hai mặt cắt dọc riêng biệt', 'Cao độ thiết kế của nền đường là cao độ vai đường', 'Cao độ thiết kế của nền đường là cao độ mép mặt đường', 2, '2021-04-06 06:46:28', '2021-04-06 06:46:28'),
