(117, 2, 1, 'Độ bằng phẳng của mặt đường có thể dùng thước 3 mét để kiểm tra; Đối với mặt đường cấp cao A2 (bê tông nhựa nguội, trên có láng mặt, thấm nhập nhựa, láng nhựa) thì quy định nào đúng trong các phương án sau?', 'Tất cả phải dưới 5 mm', '20% số khe hở dưới 3mm và 80% số khe hở phải dưới 5 mm', '30% số khe hở dưới 3mm và 70% số khe hở phải dưới 5 mm', '40% số khe hở dưới 3mm và 60% số khe hở phải dưới 5 mm', 1, '2021-04-06 06:48:33', '2021-04-16 02:17:06'),
(118, 2, 1, 'Cường độ kết cấu áo đường mềm được đặc trưng bởi giá trị nào trong các phương án sau?', 'Mô đun đàn hồi của các lớp mặt đường', 'Mô đun đàn hồi của các lớp móng đường', 'Mô đun đàn hồi của lớp nền đất dưới kết cấu áo đường', 'Mô đun đàn hồi chung của các lớp trong kết cấu áo đường + nền đất', 4, '2021-04-06 06:49:49', '2021-04-06 06:49:49'),
(119, 2, 1, 'Hãy cho biết nguyên lý xác định vị trí trục trung hòa của mặt cắt dầm BTCT hoặc bê tông ứng suất trước chịu uốn?', 'Xác định theo nguyên lý hình học tìm trọng tâm tiết diện nguyên của bê tông', 'Xác định theo nguyên lý hình học tìm trọng tâm tiết diện tính đổi từ cốt thép sang bê tông', 'Từ phương trình cân bằng các thành phần lực trong các loại cốt thép và hợp lực của khối ứng suất vùng bê tông chịu nén', 'Dựa vào tỉ lệ giữa chiều cao vùng chịu nén của bê tông và chiều cao có hiệu của tiết diện x/h0 ứng với hàm lượng cốt thép tối đa', 3, '2021-04-06 06:50:54', '2021-04-06 06:50:54'),
(120, 2, 1, 'Trong các đường cong bằng bán kính nhỏ phải bố trí siêu cao, độ dốc siêu cao phụ thuộc vào vận tốc thiết kế và bán kính đường cong. Tiêu chuẩn thiết kế quy định độ dốc tối đa và độ dốc tối thiểu. Các phương án sau phương án nào đúng với quy định?', 'Độ dốc siêu cao tối đa 10%, tối thiểu 2%', 'Độ dốc siêu cao tối đa 8%, tối thiểu 2%', 'Độ dốc siêu cao tối đa 6%, tối thiểu 2%', 'Độ dốc siêu cao tối đa 4%, tối thiểu 2%', 2, '2021-04-06 06:51:34', '2021-04-24 01:36:09'),
(121, 2, 1, 'Độ bằng phẳng mặt đường được đánh giá qua chỉ số độ gồ ghề quốc tế IRI (m/km). Với đường vận tốc thiết kế Vtk = 60 km/h, làm mới thì IRI yêu cầu phải là phương án nào trong số phương án sau?', 'Chỉ số IRI yêu cầu ≤ 2,0', 'Chỉ số IRI yêu cầu ≤ 2,2', 'Chỉ số IRI yêu cầu ≤ 2,5', 'Chỉ số IRI yêu cầu ≤ 4,0', 3, '2021-04-06 06:52:57', '2021-04-06 06:52:57'),
(122, 2, 1, 'Độ bằng phẳng mặt đường được đánh giá qua chỉ số độ gồ ghề quốc tế IRI (m/km). Với đường vận tốc thiết kế Vtk = 60 km/h, cải tạo, nâng cấp thì IRI yêu cầu phải là phương án nào trong số phương án sau?', 'Chỉ số IRI yêu cầu ≤ 2,5', 'Chỉ số IRI yêu cầu ≤ 2,8', 'Chỉ số IRI yêu cầu ≤ 3,0', 'Chỉ số IRI yêu cầu ≤ 5,0', 3, '2021-04-06 06:53:55', '2021-04-06 06:53:55'),
(123, 2, 1, 'Độ bằng phẳng của mặt đường có thể dùng thước 3 mét để kiểm tra; Đối với các mặt đường cấp thấp B1, B2 thì quy định nào đúng trong các phương án sau?', '20% số khe hở dưới 3mm và 80% số khe hở phải dưới 5 mm', '30% số khe hở dưới 3mm và 70% số khe hở phải dưới 5 mm', '40% số khe hở dưới 3mm và 60% số khe hở phải dưới 5 mm', 'Tất cả phải dưới 10 mm', 4, '2021-04-06 06:55:01', '2021-04-22 19:59:21'),
(124, 2, 1, 'Khi đắp nền đường trên đất yếu phải sử dụng lớp đệm cát để thoát nước ngang. Trong các trường hợp sau trường hợp nào phải dùng tầng đệm cát?', 'Trường hợp đắp trực tiếp trên đất yêu', 'Trường hợp đào một phần hay toàn bộ tầng đất yếu', 'Sử dụng giếng cát hay bấc thấm thoát nước thẳng đứng', 'Tất cả 3 trường hợp trên', 4, '2021-04-06 06:56:22', '2021-04-16 02:17:18'),
(125, 2, 1, 'Chiều rộng một làn xe trong tiêu chuẩn thiết kế đường TCVN 4054 - 2005 có mấy loại kích thước? Phương án nào đúng và đủ?', 'Có các chiều rộng 3,75 m, 3,5 mét, 3,0 m và 2,75 m', 'Có các chiều rộng 3,75 m, 3,5 mét và 3,0 m', 'Có các chiều rộng 3,75 m, 3,5 mét', 'Chỉ có chiều rông 3,5 m', 1, '2021-04-06 06:57:28', '2021-04-06 06:57:28'),
(126, 2, 1, 'Trong tiêu chuẩn thiết kế yếu tố hình học của đường quy định mấy loại bán kính đường cong nằm tối thiểu? Phương án nào đúng và đủ?', 'Bán kính đường cong nằm tối thiểu giới hạn', 'Bán kính đường đường cong tối thiểu giới hạn, tối thiểu thông thường', 'Bán kính đường cong tối thiểu giới hạn, tối thiểu không siêu cao', 'Bán kính tối thiểu giới hạn, tối thiểu thông thường và tối thiểu không siêu cao', 4, '2021-04-06 06:58:08', '2021-04-15 06:23:40'),
(127, 2, 1, 'Trong thiết kế đường việc phối hợp giữa các yếu tố tuyến nhằm mục đích gì?', 'Tạo tầm nhìn tốt, cung cấp thông tin cho người lái xe để kịp thời xử trí các tình huống', 'Tạo tâm lý thoải mái cho người lái, ít mệt nhọc, năng suất cao', 'Tạo cho công trình phù hợp với cảnh quan, góp phần nâng cao vẻ đẹp khu vực đặt tuyến', 'Để đạt tất cả mục đích nêu trên', 4, '2021-04-06 06:58:53', '2021-04-15 06:24:14'),
(128, 2, 1, 'Trong tiêu chuẩn thiết kế đường quy định độ đốc dọc lớn nhất tùy thuộc vào cấp hạng đường và điều kiện địa hình. Trường hợp đường cấp III, miền núi thì độ dốc dọc lớn nhất là bao nhiêu?', 'Độ dốc dọc lớn nhất 4%', 'Độ dốc dọc lớn nhất 5%', 'Độ dốc dọc lớn nhất 6%', 'Độ dốc dọc lớn nhất 7%', 4, '2021-04-06 07:00:01', '2021-04-06 07:00:01'),
(129, 2, 1, 'Quy định về hệ số đầm chặt đất nền đường phụ thuộc vào các yếu tố nào?', 'Phụ thuộc vào nền đường đào, đắp', 'Phụ thuộc vào cấp hạng kỹ thuật của đường', 'Phụ thuộc vào chiều sâu từ đáy áo đường xuống', 'Phụ thuộc vào cả 3 yếu tố trên', 4, '2021-04-06 07:00:33', '2021-04-06 07:00:33'),
(130, 2, 1, 'Độ dốc ngang của mặt đường trên các đoạn thẳng được quy định để đảm bảo thoát nước mưa, phụ thuộc vào loại mặt đường. Với mặt đường bê tông xi măng và bê tông nhựa chọn độ dốc ngang bao nhiêu là đúng?', 'Độ dốc ngang 1,5 - 2,0 %', 'Độ dốc ngang 1,5 - 3,0 %', 'Độ dốc ngang 2,0 - 3,0 %', 'Độ dốc ngang 3,0 - 4,0 %', 1, '2021-04-06 07:01:05', '2021-04-06 07:01:05'),
(131, 2, 1, 'Để dẫn hướng xe chạy an toàn thì tại những vị trí có ta luy âm lớn hơn giá trị quy định, đường cong bán kính nhỏ, đường dẫn lên cầu phải bố trí cọc tiêu. Theo quy định chiều cao bao nhiêu phải bố trí cọc tiêu?', 'Khi chiều cao ta luy từ 1,0 m', 'Khi chiều cao ta luy từ 1,5 m', 'Khi chiều cao ta luy từ 2,0 m', 'Khi chiều cao ta luy từ 2,5 m', 3, '2021-04-06 07:01:39', '2021-04-06 07:01:39');
INSERT INTO `cauhois` (`idcauhoi`, `linhvuc`, `trangthai`, `cauhoi`, `dapan1`, `dapan2`, `dapan3`, `dapan4`, `dapandung`, `created_at`, `updated_at`) VALUES
(132, 2, 1, 'Để đảm bảo an toàn xe chạy thì tại những vị trí nền đường đắp cao lớn hơn giá trị quy định, đường dẫn lên cầu, cầu cạn... phải bố trí lan can phòng hộ. Theo quy định chiều cao bao nhiêu phải bố trí lan can phòng hộ?', 'Khi chiều cao hơn 2,0 m', 'Khi chiều cao hơn 3,0 m', 'Khi chiều cao hơn 4,0 m', 'Khi chiều cao hơn 5,0 m', 3, '2021-04-06 07:02:15', '2021-04-06 07:02:15'),
(133, 2, 1, 'Khẩu độ thoát nước dùng trong thiết kế cầu là gì?', 'Là chiều rộng mặt nước của sông tại mức nước cao nhất', 'Là tổng các chiều rộng mặt thoáng dưới cầu tính theo mức nước cao nhất', 'Là khoảng cách thông thủy giữa hai mố cầu tính theo mức nước cao nhất', 'Là chiều rộng mặt nước của sông tại mức nước lũ lịch sử', 3, '2021-04-06 07:02:59', '2021-04-06 07:02:59'),
(134, 2, 1, 'Chiều cao đáy dầm của kết cấu nhịp cầu vượt sông được xác định như thế nào?', 'Điểm thấp nhất của đáy dầm cao hơn mực nước cao nhất (MNCN) 0,5m', 'Điểm thấp nhất của đáy dầm cao hơn MNCN 0,7m', 'Điểm thấp nhất của đáy dầm cao hơn MNCN 0,7m đối với sông có cây trôi và 0,5m đối với sông không có cây trôi', 'Điểm thấp nhất của đáy dầm cao hơn MNCN 1,0 m đối với sông có cây trôi và 0,5m đối với sông không có cây trôi', 4, '2021-04-06 07:04:15', '2021-04-06 07:04:15'),
(135, 2, 1, 'Mức nước thông thuyền dưới cầu được xác định như thế nào?', 'Là mức nước trung bình trong năm', 'Là mức nước lũ tính với tần suất 15 năm xảy ra một lần', 'Là mức nước lũ tính với tần suất 10%', 'Là mức nước lũ tính với tần suất 5%', 4, '2021-04-06 07:04:53', '2021-04-06 07:04:53'),
(136, 2, 1, 'Để đảm bảo thoát nước khỏi mặt cầu, hệ thống ống thoát nước phải đáp ứng những yêu cầu gì?', '1m2 mặt cầu ít nhất có 4cm2 diện tích ống thoát', '1m2 mặt cầu ít nhất có 4cm2 diện tích ống thoát và đường kính trong của ống thoát Dtr≥ 150mm', '1m2 mặt cầu ít nhất có 1cm2 diện tích ống thoát, đường kính trong của ống Dtr≥90mm và cự ly giữa các ống thoát ≤ 10m/ống', '1m2 mặt cầu ít nhất có 1cm2 diện tích ống thoát, đường kính trong của ống Dtr≥100mm và cự ly giữa các ống thoát ≤ 15m/ống', 4, '2021-04-06 07:05:30', '2021-04-06 07:05:30'),
(137, 2, 1, 'Chiều dày bảo vệ đối với cốt thép trong điều kiện môi trường khô cạn bình thường tối thiểu là bao nhiêu?', '1,5 đường kính cốt thép', '3,5cm', '3,0cm', '2,5cm', 4, '2021-04-06 07:06:41', '2021-04-06 07:06:41'),
(138, 2, 1, 'Chiều dày bảo vệ đối với cốt thép đứng của cọc khoan nhồi được chọn là bao nhiêu?', '5,0cm', '7,5 cm', '9,0cm', '3,0 lần đường kính cốt thép', 3, '2021-04-06 07:07:29', '2021-04-06 07:07:29'),
(139, 2, 1, 'Cự li tối đa của cốt thép cấu tạo bố trí trong dầm bê tông được quy định như thế nào?', 'Không vượt quá chiều dày của bộ phận kết cấu hoặc 250mm', 'Không vượt quá chiều dày của bộ phận kết cấu hoặc 300mm', 'Không vượt quá 1,5 chiều dày bộ phân kết cấu và 400mm', 'Không vượt quá 1,5 chiều dày bộ phận kết cấu và 450mm', 4, '2021-04-06 07:08:13', '2021-04-06 07:08:13'),
(140, 2, 1, 'Cự li giữa các tao cáp đơn đường kính 12,7mm bố trí trong dầm bê tông dự ứng lực chế tạo theo công nghệ căng trước, bê tông đá 1x2 được bố trí tối thiểu là bao nhiêu?', '51mm', '44mm', '39mm', '38mm', 2, '2021-04-06 07:08:52', '2021-04-06 07:08:52'),
(141, 2, 1, 'Mật độ kiểm tra độ chặt của mỗi lớp đất đắp sau khi đầm nén xong được quy định như thế nào?', 'Tối thiểu 3 vị trí trên 1000 m2', 'Tối thiểu 2 vị trí trên 1000 m2', 'Tối thiểu 2 vị trí trên 1500 m2', 'Tối thiểu 3 vị trí trên 1500 m2', 2, '2021-04-06 07:09:44', '2021-04-06 07:09:44'),
(142, 2, 1, 'Khi nghiệm thu độ bằng phẳng của mặt trên cùng nền đường ô tô cấp III sau khi thi công (cả với nền đào và nền đắp) bằng thước dài 3 m, phải thỏa mãn điều kiện nào sau đây?', '100% số khe hở dưới thước dài 3 m không vượt quá 15 mm', '70% số khe hở dưới thước dài 3 m không vượt quá 7 mm, còn lại không vượt quá 15 mm', '70% số khe hở dưới thước dài 3 m không vượt quá 15 mm, còn lại không vượt quá 20 mm', '100% số khe hở dưới thước dài 3 m không vượt quá 20 mm', 3, '2021-04-06 07:10:42', '2021-04-06 07:10:42'),
(143, 2, 1, 'Khi kiểm tra nghiệm thu kích thước hình học của nền đường sau thi công đối với đường cao tốc, cấp I, II và III, sai số cho phép của vị trí trục tim tuyến đường là bao nhiêu?', 'Không quá 30 mm', 'Không quá 50 mm', 'Không quá 70 mm', 'Không quá 100 mm', 2, '2021-04-06 07:11:14', '2021-04-06 07:11:14'),
(144, 2, 1, 'Nhiệt độ tối thiểu cho phép đổ hỗn hợp bê tông nhựa nóng từ xe ô tô vào phễu của máy rải là bao nhiêu?', '110 độ C khi sử dụng loại nhựa đường 60/70', '120 độ C khi sử dụng loại nhựa đường 60/70', '125 độ C khi sử dụng loại nhựa đường 60/70', '130 độ C khi sử dụng loại nhựa đường 60/70', 3, '2021-04-06 07:12:34', '2021-04-06 07:12:34'),
(145, 2, 1, 'Điều kiện thời tiết nào dưới đây xảy ra thì không được phép thi công hỗn hợp bê tông nhựa rải nóng?', 'Nhiệt độ không khí lớn hơn 15 độ C', 'Trời mưa', 'Nhiệt độ không khí thấp hơn 15 độ C', 'Cả hai trường hợp B và C', 4, '2021-04-06 07:13:07', '2021-04-06 07:13:07'),
(146, 2, 1, 'Phương pháp nào dưới đây được dùng để xác định hàm lượng nhựa tối ưu của hỗn hợp bê tông nhựa chặt được sử dụng ở Việt Nam?', 'Phương pháp Marshall', 'Phương pháp Superpave', 'Phương pháp Hveen', 'Tất cả các phương pháp trên', 1, '2021-04-06 07:13:38', '2021-04-15 06:24:38'),
(147, 2, 1, 'Chỉ tiêu nào dưới đây không dùng để đánh chất lượng của nhựa đường đặc 60/70?', 'Độ kim lún ở 25 độ C', 'Độ ổn định lưu trữ 24h', 'Điểm hóa mềm (dụng cụ vòng và bi)', 'Độ kéo dài ở 25 độ C', 2, '2021-04-06 07:14:35', '2021-04-06 07:14:35'),
(148, 2, 1, 'Có thể sử dụng phương pháp nào dưới đây để kiểm tra phục vụ cho công tác nghiệm thu độ bằng phẳng mặt đường bê tông nhựa?', 'Phương pháp dùng thước 3 m', 'Phương pháp sử dụng thiết bị đo IRI', 'Cả hai phương pháp a và b', 'Phương pháp sử dụng thiết bị đo độ xóc tích lũy', 3, '2021-04-06 07:15:13', '2021-04-06 07:15:13'),
