(257, 2, 1, 'Để đánh giá chất lượng của mặt đường bê tông xi măng khi nghiệm thu, chỉ tiêu nào sau đây được sử dụng?', 'Cường độ nén của bê tông xi măng', 'Cường độ kéo khi uốn của bê tông xi măng', 'Độ mài mòn, cường độ chịu nén của đá gốc', 'Độ mài mòn của bê tông xi măng', 2, '2021-04-06 18:08:58', '2021-04-06 18:08:58'),
(258, 2, 1, 'Kiểm tra lượng nhựa đường phun tưới trên mặt đường khi thi công bằng cách nào?', 'Quan sát bằng mắt để đánh giá', 'Kiểm tra bằng cách rải tấm cứng trên đường trước khi phun tưới nhựa qua', 'Kiểm tra khối lượng nhựa đường sử dụng tương ứng với diện tích đã tưới', 'Kết hợp các cách trên để kiểm tra', 4, '2021-04-06 18:09:23', '2021-04-06 18:09:23'),
(259, 2, 1, 'Phương pháp Marshall được dùng để làm gì?', 'Xác định cấp phối cốt liệu tối ưu cho hỗn hợp bê tông nhựa chặt rải nóng', 'Xác định hàm lượng nhựa tối ưu tương ứng với một cấp phối cốt liệu xác định của hỗn hợp bê tông nhựa chặt rải nóng', 'Xác định các chỉ tiêu thể tích của hỗn hợp bê tông nhựa', 'Xác định khả năng kháng lún của hỗn hợp bê tông nhựa', 2, '2021-04-06 18:09:46', '2021-04-06 18:09:46'),
(260, 2, 1, 'Số lượng mẫu bê tông nhựa tối thiểu cần phải đúc để xác định hàm lượng nhựa tối ưu trong phương pháp thiết kế Marshall?', '18 mẫu', '15 mẫu', '12 mẫu', '5 mẫu', 2, '2021-04-06 18:10:30', '2021-04-06 18:10:30'),
(261, 2, 1, 'Phương pháp phễu rót cát sử dụng ở hiện trường dùng để xác định chỉ tiêu nào đây?', 'Độ chặt của vật liệu', 'Độ bằng phẳng', 'Độ nhám', 'Độ ẩm của vật liệu', 1, '2021-04-06 18:10:48', '2021-04-06 18:10:48'),
