(265, 2, 1, 'Việc phát hiện những sai sót bất hợp lý trong hồ sơ thiết kế và đề nghị đơn vị có thẩm quyền bổ sung, chỉnh lý được tiến hành trong công tác nào sau đây?', 'Công tác chuẩn bị', 'Công tác thi công', 'Công tác nghiệm thu', 'Cả ba đáp án trên', 1, '2021-04-06 18:12:00', '2021-04-06 18:12:00'),
