(268, 2, 1, 'Khi độ dốc ngang mặt đất tự nhiên lớn hơn 10% thì hố đấu được đào ở phía nào?', 'Ở phía trên', 'Ở phía dưới', 'Cả 2 bên', 'Cả ba đáp án trên đều được', 1, '2021-04-06 18:12:42', '2021-04-06 18:12:42'),
